:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, John William and BUSBY, Sarah
  JWILLIAMS, Kenneth Stuart and LUDBROOK, Lillian Mary
  WILLIAMS, Kenneth Stuart and LUDBROOK, Lillian Mary (cont...)
  call this the "Karewa" Block; it is run in conjunction with "Matahiia". Jeremy returned home in 1980 and
  became manager in 1985. On the night of his wedding, 08 November 1986, the Matahiia Homestead was burnt down
  by Rastafarian arsonists.
  In 1984 Stuart Williams sold "Taitai" station to the Government for forestry and in 1987 he sold
  "Mangarewarewa" to "Matahiia", which became the new "Matahiia" homestead. This meant that this block became
  once again the property of "Matahiia".
  In March 1988, "Matahiia" station, like many other East Coast properties, was hit by Cyclone Bola causing
  extensive damage to the land. A month later a group of Ruatoria arsonists burnt down the old kauri woolshed
  and various other buildings.
  Jeremy and Jane Williams now live on the "Matahiia "block, and Tim and Samantha Williams live on the "Karewa"
  block which is run in conjunction with "Matahiia" station.
  01> WILLIAMS, Charles Kenneth m on 14.09.1926 to MORRIS, Phyllis Constance
  b 27.11.1899 d 12.09.1978
  b 31.03.1905 d 26.07.1993
  Charles b. at Matahiia. Phyllis, d/o John Bentham Morris (farmer) and Annie Isabella
  Gallagher.
  Charles was a sheepfarmer at "Matahiia", Ruatoria. He was an inaugural member and President
  of the Waiapu Racing Club (now wound up) and active in the Ruatoria Show Association and the
  Waiapu Dog Trial Club. He held executive positions in the Federated Farmers and the National
  Party and was a vestryman, warden and synodsman of the Ruatoria parish. He was on the
  Waitangi Trust Board for 40 years from 1935. He was also a good rifle shot and an expert bushman, having
  explored extensively in the Raukumara Ranges.
  Phyllis bred and showed horses. She was a singer and a broadcaster of Maori songs (1937-1958). In 1932 she
  was invited to join a Maori concert group which was working to raise 150 Pounds toward an x-ray unit for
  the Te Puia Hospital. They were coached by Mataroa Reedy and Phyllis was given the Maori name, Kirimamae by
  which she is still known. She later belonged to the Hiruharama Haka Party and in 1960 and 1961 she
  performed on the Waitangi Marae for the celebrations.
  01> WILLIAMS, Kenneth Sydney M on 30.01.1953 to WATKINS, Elizabeth Josephine
  b 22.10.1927 d 13.08.1990
  b 05.05.1930
  Kenneth b. at Gisborne, m. at "Ohinepoutea", Ruatoria, d. at Manutuke and cremated.
  Josephine, d/o Bertrand Coleman Watkins and Elizabeth Macky MacLaurin. Address:
  "Kahukura", Wainaake Road, Manutuke, Gisborne.
  Kenneth was educated at Hereworth School and Christ's College. He farmed on "Matahiia",
  Ruatoria until he retired to Manutuke where he farmed 97 acres. He served as Secretary
  and President of the Waiapu Show and Waipu Dog Trial (where he also judged). He was a
  Vestryman for the Waipiro Parochial District, a committee member of the Gisborne Veterinary Club, on
  the Makarika School Committee and, after coming to Manutuke, a member of the Cook County Council. He
  was a keen rugby player and cricketer and later developed an interest in trout fishing.
  Jose was educated at Queenswood School and Woodford House. She worked on the family farm until marriage
  and was actively involved in community and church work.
  01> WILLIAMS, Jeremy Kenneth m on 08.11.1986 to HOLDEN, Jane Barker
  b 11.08.1954
  b 16.06.1960
  Jeremy b. at Waipiro Bay and m. at Gisborne. Jane, d/o Michael Holden and Jennifer
  Barker, b. at Gisborne. Address: "Matahiia" RD, Ruatoria.
  Jeremy was educated at Hereworth School and Christ's College. He worked in Australia
  and the Wairarapa before going back to "Matahiia" where he has a polled Angus stud
  which he started in 1989. Jeremy is President of the Waiapu Show and the Ruatoria
  branch of Federated Farmers.
  01> WILLIAMS, Jennifer Rose
  b 18.01.1988
  Jennifer b. at Gisborne.
